import React from "react";
import { StyleSheet } from "react-native";

const StyleHeadr = StyleSheet.create({
    header :{
        display: "flex",
        flexDirection: 'row',
        width: "100%",
        height: "20%",
        backgroundColor: '#E7E6E4',
        borderwidth:5,
        borderColor : '#A19C91'
    },
    container :{
        display: "flex",
        flexDirection: 'row',
        alignItems:'center',
        alignContent:'space-around',
        justifyContent: 'space-between'
    }
});

export default StyleHeadr;
